import React from 'react'

const MainPage = () => {
  return (
    <div>
    // <table className='table__content'>
    //     <tr className='row__content'>
    //       <th>Claim ID</th>
    //       <th>Name</th>
    //       <th>Ailment</th>
    //       <th>SLA</th>
    //       <th>P-TAT</th>
    //       <th>Stage</th>
    //       <th>Status</th>
    //       <th>Approved Amount</th>
    //       <th>Hospital</th>
    //     </tr>
    //     {/* {patients.map((Healspan) => (
    //       <tr key={Healspan.id}>
    //         <td>{Healspan.claimId}</td>
    //         <td>{Healspan.name}</td>
    //         <td>{Healspan.ailment}</td>
    //         <td>{Healspan.sla}</td>
    //         <td>{Healspan.ptat}</td>
    //         <td>{Healspan.stage}</td>
    //         <td>{Healspan.status}</td>
    //         <td>{Healspan.approvedAmount}</td>
    //         <td>{Healspan.hospital}</td>
    //       </tr>
    //     ))} */}
    //     <tr className='row__content'>
    //     <td>1234</td>
    //     <td>4567</td>
    //     <td>4567</td>
    //     <td>4567</td>
    //     <td>4567</td>
    //     <td>4567</td>
    //     <td>4567</td>
    //     <td>4567</td>
    //     <td>4567</td>
    //     </tr>
    //     <tr className='row__content'>
    //     <td>1234</td>
    //     <td>4567</td>
    //     <td>4567</td>
    //     <td>4567</td>
    //     <td>4567</td>
    //     <td>4567</td>
    //     <td>4567</td>
    //     <td>4567</td>
    //     <td>4567</td>
    //     </tr>
    //     <tr className='row__content'>
    //     <td>1234</td>
    //     <td>4567</td>
    //     <td>4567</td>
    //     <td>4567</td>
    //     <td>4567</td>
    //     <td>4567</td>
    //     <td>4567</td>
    //     <td>4567</td>
    //     <td>4567</td>
    //     </tr>
    // </table>
    <h1>A Fancy Table</h1>

    <table id="customers">
    <tr>
    <th>Company</th>
    <th>Contact</th>
    <th>Country</th>
  </tr>
  <tr>
    <td>Alfreds Futterkiste</td>
    <td>Maria Anders</td>
    <td>Germany</td>
  </tr>
  <tr>
    <td>Berglunds snabbköp</td>
    <td>Christina Berglund</td>
    <td>Sweden</td>
  </tr>
  <tr>
    <td>Centro comercial Moctezuma</td>
    <td>Francisco Chang</td>
    <td>Mexico</td>
  </tr>
  <tr>
    <td>Ernst Handel</td>
    <td>Roland Mendel</td>
    <td>Austria</td>
  </tr>
  <tr>
    <td>Island Trading</td>
    <td>Helen Bennett</td>
    <td>UK</td>
  </tr>
  <tr>
    <td>Königlich Essen</td>
    <td>Philip Cramer</td>
    <td>Germany</td>
  </tr>
  <tr>
    <td>Laughing Bacchus Winecellars</td>
    <td>Yoshi Tannamuri</td>
    <td>Canada</td>
  </tr>
  <tr>
    <td>Magazzini Alimentari Riuniti</td>
    <td>Giovanni Rovelli</td>
    <td>Italy</td>
  </tr>
  <tr>
    <td>North/South</td>
    <td>Simon Crowther</td>
    <td>UK</td>
  </tr>
  <tr>
    <td>Paris spécialités</td>
    <td>Marie Bertrand</td>
    <td>France</td>
  </tr>
</table>
</div>
  )
}

export default MainPage
